const React = require("react");
// const { useChange } = require("./Data_Table");
// const axios = require("axios");
// const { useState } = require("react");


export function useChange() {
    const [state, setState] = useState(null);
    function change(e) {
      setState(e);
    }
  
    return { change, state };
  }
 
const All_data = () => {

    const { state } = useChange();
    const check_state = state.map (e => {
        return e.id;
    })
    return {check_state}
}

module.exports.All_data = All_data;
